import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import React, {useState, useEffect} from "react";
import { Form, Input, Checkbox, Button, Col } from "antd";
import { Layout } from 'antd';
import axios from 'axios';


const {Header, Content, Footer} = Layout;

const ChiTietNV = () => {
    const [componentSize, setComponentSize] = useState('default');

    const onFormLayoutChange = ({ size }) => {
      setComponentSize(size);
    };
    
    const [ctnv, setNVGH] = useState([]);
  
    useEffect(() => {
      axios
        .get("http://localhost:5000/api/NVQL/ctnv/" + JSON.parse(window.localStorage.getItem("MaNV")))
        .then((res) => {
          console.log(res.data)
          setNVGH(res.data)
        })
        .catch((err) => {
          console.log(err);
        });
      }, []);
  
    
    return (
      <div>

      <Form
        labelCol={{
          span: 4,
        }}
        wrapperCol={{
          span: 14,
        }}
        layout="horizontal"
        initialValues={{
          size: componentSize,
        }}
        onValuesChange={onFormLayoutChange}
        size={componentSize}
      >
        
        <Form.Item label="Mã Nhân viên">
          <Input defaultValue={ctnv[0].MaNV} disabled/>
        </Form.Item>
        <Form.Item label="Tên Nhân viên">
          <Input defaultValue={ctnv[0].Ten} disabled/>
        </Form.Item>
        <Form.Item label="Giới Tính">
          <Input defaultValue={ctnv[0].GioiTinh} disabled/>
        </Form.Item>
        <Form.Item label="Số điện thoại">
          <Input defaultValue={ctnv[0].Sdt} disabled/>
        </Form.Item>
        <Form.Item label="Ngày sinh">
          <Input defaultValue={ctnv[0].NgaySinh} disabled/>
        </Form.Item>
        <Form.Item label="Số nhà">
          <Input defaultValue={ctnv[0].SoNha} disabled/>
        </Form.Item>
        <Form.Item label="Đường">
          <Input defaultValue={ctnv[0].Duong} disabled/>
        </Form.Item>
        <Form.Item label="Phường">
          <Input defaultValue={ctnv[0].Phuong} disabled/>
        </Form.Item>
        <Form.Item label="Quận">
          <Input defaultValue={ctnv[0].Quan} disabled/>
        </Form.Item>
        <Form.Item label="Thành Phố">
          <Input defaultValue={ctnv[0].ThanhPho} disabled/>
        </Form.Item>
        <Form.Item label="Email">
          <Input defaultValue={ctnv[0].Email} disabled/>
        </Form.Item>
        <Form.Item label="Mật Khẩu">
          <Input defaultValue={ctnv[0].MatKhau} disabled/>
        </Form.Item>
        <Form.Item label="Ngày Vào Làm">
          <Input defaultValue={ctnv[0].NgayVaolam} disabled/>
        </Form.Item>
        <Form.Item label="Lương">
          <Input defaultValue={ctnv.Luong} disabled/>
        </Form.Item>
        <Form.Item label="Đơn Hàng đã giao">
          <Input defaultValue={ctnv.DonHangDaGiao} disabled/>
        </Form.Item>
        <Form.Item label="Mã người Quản lý">
          <Input defaultValue={ctnv.MaQL} disabled/>
        </Form.Item>
        
      </Form>
      </div>
    );
  }
  
  export default ChiTietNV;
